// axiosInstance.js
import axios from 'axios';

const axiosInstance = axios.create({
  baseURL: 'http://localhost:4000/api/user/',
  withCredentials: true,
  headers: {
    'Content-type': 'application/json',
  },
});

export default axiosInstance;
